<h2>Rectangle Creator</h2>
<p>Count: <input id="count" type="number" value="5"></p>
<button id="create">Create</button>
<button id="cancel">Cancel</button>
<style>
  body{
    margin: 0px;
  }

    rect[width="16"][height="16"] {
      cursor: pointer;
    }
      rect[width="16"][height="16"]:not(.active):hover{
        fill: #0A5555;
      }

    </style>

<script>

//I can trigger actions based on buttons pressed
document.getElementById('create').onclick = () => {
  const textbox = document.getElementById('count');
  const count = parseInt(textbox.value, 10);
  parent.postMessage({ pluginMessage: { type: 'update-datavis', count } }, '*')
}

document.getElementById('cancel').onclick = () => {
  parent.postMessage({ pluginMessage: { type: 'cancel' } }, '*')
}

//I can receive messages from the plugin with data containing the selected elements
window.onmessage = (event) => {
  console.log(document.querySelector('#screen1'))
  document.querySelector('#screen1').style.display = 'none';
  document.querySelector('#screen2').style.display = 'block';
  console.log(event.data.pluginMessage)
}

//I confirmed that pasting works
var i = 0;
window.addEventListener("paste", (event) => {
     event.preventDefault();
  let paste = (event.clipboardData || window.clipboardData).getData("text/html");
    console.log(paste)
    paste = (event.clipboardData || window.clipboardData).getData("text");
    console.log(paste)
    //hide screen2 and show screen 3
    document.querySelector('#screen2').style.display = 'none';
    document.querySelector('#screen3').style.display = 'block';

    document.querySelectorAll("rect[width=\"16\"][height=\"16\"]").forEach((elt) => {
      //elt.setAttribute('fill','#54E054')

      elt.addEventListener('click', (evt) => {
        console.log('test', i)
        parent.postMessage({ pluginMessage: { type: "test", count:i } }, '*')
        i += 1;
        elt.setAttribute('fill','#54E054')
        elt.classList.add('active')
      })
    })
});

//On drop event
window.addEventListener("drop", (event) => {
  console.log("drop action initiated");
  console.log(event);
});
document.designMode = "on"
</script>
